import React, { Component } from 'react';

class Game extends Component {
  constructor() {
    super();
  }

  render() {
    let wordLine = [];

    for (let i = 0; i < 5; i += 1) {
      wordLine.push(
        <input id={`letter${i}`} type="text" className="wordBox" maxLength="1" />
      )
    }

    return (
      <main>
        <form>
          { wordLine.map((letter) => letter) }
        </form>
      </main>
    );
  }
}

export default Game;
